anity :) \n\nI hope you enjoyed the story!\n\n----\n\nDescription: This masterpiece is the 1st design of Cryptocurrency available in NFTs market for people to deal with today, signed by the first designer of first NFTs Cryptocurrency. \n\nIt's designed as a mix between the history and the future with the joy of a story of fantasy :)\n\nEvery coin is one of the kind that has its unique serial number. Beside Ethereum it is written the year when it's minted in both decimal and binary systems. The characters in the back of the coin matches the value of it.\n\n----\n\nAnimation: it's designed in a way to show you first the overview of the coin by a quick rotation and then stops in each side of the coin for 2s to allow you to have a deep look at its details.\n\n----\n\nThank you very much for viewing, reading and we hope you enjoyed it :)","hasUnlockableContent":false,"assetEventData":{"firstTransfer":null,"lastSale":null},"decimals":null,"orderData":{"bestBid":{"orderType":"BASIC","paymentAssetQuantity":{"asset":{"decimals":6,"imageUrl":"https://lh3.googleusercontent.com/PxC_K0Y22A1Xs0CeVknf4YUSxSqH_1bPCG0a4uD7WRkwbbtinqryjDEvoTYSbBFDXXTliuyo38-Y_ecNUEj0fMimQA","symbol":"USDC","usdSpotPrice":0.998406,"assetContract":{"blockExplorerLink":"https://etherscan.io/address/0xa0b86991c6218b36c1d19d4a2e9eb0ce3606eb48","account":{"chain":{"identifier":"ETHEREUM","id":"Q2hhaW5UeXBlOjE="},"id":"QWNjb3VudFR5cGU6MjA1Mzg1"},"id":"QXNzZXRDb250cmFjdFR5cGU6MjA2OQ=="},"id":"QXNzZXRUeXBlOjQ0MDM5MDg="},"quantity":"100000","id":"QXNzZXRRdWFudGl0eVR5cGU6MzMzNDk1NDk2MTQ5MTY5MDI4NjI2MjkzNTE0MTc2ODY4Nzk1Njkz"}},"bestAsk":{"closedAt":null,"orderType":"BASIC","dutchAuctionFinalPrice":null,"openedAt":"2021-05-25T18:20:38.755907","priceFnEndedAt":null,"quantity":"1","decimals":null,"paymentAssetQuantity":{"quantity":"100000000000000000","asset":{"decimals":18,"imageUrl":"https://storage.opensea.io/files/6f8e2979d428180222796ff4a33ab929.svg","symbol":"ETH","usdSpotPrice":2570.19,"assetContract":{"bloc